import { Fragment } from "react";
import { Route } from "react-router-dom";
import Welcome from "./components/Welcome";
import Product from "./components/Product";

function App() {
  return (
    <Fragment>
      <Route path="/welcome">
        <Welcome />
      </Route>
      <Route>
        <Product />
      </Route>
    </Fragment>
  );
}

export default App;
